  justify-content: space-between;
  transform: scale(1, 1);
}

.laptop {
  position: relative;
  left: -10%;
  background-image: url("/img/Qarothome.jpg");
  background-position: -8vw 30%;
  width: 70%;
  height: 88%;
  background-size: cover;
  background-repeat: no-repeat;
  border-top-right-radius: 5%;
}

.iphone {
  background-image: url("/img/qarotmobile.jpg");
  margin-right: 8%;
  background-size: cover;
  max-width: 280px;
  max-height: 560px;
  width: 20%;
  height: auto;
  background-repeat: no-repeat;
  background-position: 0 60%;
  border-radius: 11%;
}

.sec2text {
  position: absolute;
  bottom: 40%;
  left: 50%;
}


.ouro {
  position: relative;
  display:inline-block;
  height: 46px;
  width: 46px;
  margin: 1em;
  border-radius: 50%;  
  background: none repeat scroll 0 0 #02383aa4;
  overflow:hidden;
  transform: scale(var(--ggs,2.8));
  cursor: pointer;
}

.ouro:after {
  content: "";
  position: absolute;
  top: 9px; left: 9px;
  display: block;
  height: 28px; width: 28px;
  background: none repeat scroll 0 0 #fffff0;
  border-radius: 50%;
}
.ouro > span {
  position: absolute;
  height: 100%; width: 50%;
  overflow: hidden;
}
.left  { left:0   }
.right { left:50% }

.anim {
  position: absolute;
  left: 100%; top: 0;
  height: 100%; width: 100%;
  border-radius: 999px;
  background: none repeat scroll 0 0 $Dark-green;
  opacity: 0.6;
  -webkit-animation: ui-spinner-rotate-left 3s 5;
  animation: ui-spinner-rotate-left 3s 5;
  -webkit-transform-origin: 0 50% 0;
  transform-origin: 0 50% 0;
}

.left .anim {
  border-bottom-left-radius: 0;
  border-top-left-radius: 0;
}
.right .anim {
  border-bottom-right-radius: 0;
  border-top-right-radius: 0;
  left: -100%;
  -webkit-transform-origin: 100% 50% 0;
  transform-origin: 100% 50% 0;
}

/* v2 */
.ouro2 .anim {
 -webkit-animation-delay:0;
 animation-delay:0;
}
.ouro2 .right .anim{
 -webkit-animation-delay: 1.5s;
 animation-delay: 1.5s;
}


/* round variation */
.round .ouro:after {display:none }


@keyframes ui-spinner-rotate-right{
0%{transform:rotate(0deg)}
25%{transform:rotate(180deg)}
50%{transform:rotate(180deg)}
75%{transform:rotate(360deg)}
100%{transform:rotate(360deg)}
}
@keyframes ui-spinner-rotate-left{
0%{transform:rotate(0deg)}
25%{transform:rotate(0deg)}
50%{transform:rotate(180deg)}
75%{transform:rotate(180deg)}
100%{transform:rotate(360deg)}
}

@-webkit-keyframes ui-spinner-rotate-right{
0%{-webkit-transform:rotate(0deg)}
25%{-webkit-transform:rotate(180deg)}
50%{-webkit-transform:rotate(180deg)}
75%{-webkit-transform:rotate(360deg)}
100%{-webkit-transform:rotate(360deg)}
}
@-webkit-keyframes ui-spinner-rotate-left{
0%{-webkit-transform:rotate(0deg)}
25%{-webkit-transform:rotate(0deg)}
50%{-webkit-transform:rotate(180deg)}
75%{-webkit-transform:rotate(180deg)}
100%{-webkit-transform:rotate(360deg)}
}


